import React from 'react';
import { Link } from 'react-router-dom';


export function NavBar() {
    return (
        <nav >
        <ul>
        <Link to='/'> 
        <span className='name'>
          iWorld!
        </span>
        </Link>
        <Link to='/About'>
          <li>About</li>
        </Link>
        </ul>
    </nav>
    )
};

export default NavBar
